  false,\n\t\"url\": null,\n\t\"notes\": \"This report, which discusses the occurrence
  of Trumpeter swans on Kenai National Moose Range, was presented at The Sixth Trumpeter
  Swan Society Conference.  The annual mean for active Trumpeter swan nest sites on
  the Kenai is 25.4. Although there has been some variation in observed active nests,
  it has been difficult to attribute this change to any specific event or happening.
  \ Since the late 1960's several Trumpeter swan nest sites have relocated due to
  lowering water tables.  On the Kenai, the Trumpeter swan population can expect to
  face continued economic expansion and human community growth. Since our survey includes
  some areas adjacent the refuge, some loss of nesting sites maybe associated with
  increased economic and human disturbance.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
